import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
	<div className="App">
	<header className="App-header">
		<h1>Chatting room</h1>
    	<h2 id="username"></h2>
    	<div class="content">
      		<div class="aside">
        		<ul class="members"></ul>
      		</div>
      		<div class="display">
        		<ul class="chatting"></ul>
        		<input type="text" id="message"/>
        		<button id="send">Send</button>
      		</div>
		</div>
	</header>
    </div> 
  );
}

export default App;
